import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import HorizontalScroll from "../../../common/HorizontalScroll";
import { artistActions } from "../../../../state/actions";
import { Box } from "@mui/system";
import { Avatar } from "@mui/material";

const Rappers = () => {
  const artistType = "rappers";
  const dispatch = useDispatch();
  dispatch(artistActions.currentArtistType(artistType));

  const titles = ["OG", "Upcoming"];
  const artists = useSelector((state) => state.artist.artists);

  useEffect(() => {
    try {
      dispatch(artistActions.artistsInfo(artistType, titles));
    } catch (error) {
      console.log("error is " + error.message);
    }
  }, []);

  return (
    // <div style={{ backgroundColor: "#272727" }}>
    <div>
      <Box sx={{ display: "flex" }}>
        <Box>
          <Box sx={{ display: "flex", flexDirection: "column" }}>
            <Box>
              <Avatar
                className="ripple"
                alt="Remy Sharp"
                src={YouTubeLogo}
                onClick={() =>
                  setTimeout(() => navigate("reactionchannels"), 1000)
                }
                sx={{ m: "auto", width: 200, height: 200 }}
              />
            </Box>
            <Box>1</Box>
            <Box>1</Box>
            <Box>1</Box>
          </Box>
        </Box>
        <Box>
          <Box sx={{ display: "flex" }}>
            <Box>1</Box>
            <Box sx={{ display: "flex" }}>
              <Box>2</Box>
              <Box>2</Box>
              <Box>2</Box>
              <Box>2</Box>
            </Box>
          </Box>
        </Box>
      </Box>
      {/* {artists !== null &&
        artists.map((horizontalScroll, i) => (
          <HorizontalScroll
            key={i}
            horizontalScroll={horizontalScroll}
            title={titles[i]}
          ></HorizontalScroll>
        ))} */}
    </div>
  );
};
export default Rappers;
